#!/usr/bin/env python

stream = ''
#test_stream = 'nznrnfrfntjfmvfwmzdfjlvtqnbhcprsg'

def solve(i):
    group = list(stream[:i])
    index = i
    for char in list(stream)[i:]:
        if len(set(group)) != i:
            group.pop(0)
            group.append(char)
            index += 1
        else:
            return index

    return 0

def day6():
    print("Part 1: ", solve(4))
    print("Part 2: ", solve(14))

day6()